import styled from "styled-components";

export const StyledButton = styled.button`
    border:none;
    background-color:#F8A607;
    color: white;
    border-radius: .6rem;
    font-weight: bold;
    padding: 1rem 2rem;
    font-size: 1rem;
    cursor: pointer;
    &:hover {
        background-color:#f85f07;
    }
`
